const Input = ({ type, placeholder, value, onChange, className }) => {
  return (
    <input
      type={type}
      placeholder={placeholder}
      value={value}      
      onChange={onChange} // 부모에서 받은 onChange
      className={`input ${className}`}
    />
  );
};

export default Input;
